  {
    Exi_VBSDecodeSchemaDeviation(DecWsPtr, &ExiEventCode, 1, 1, FALSE, FALSE, FALSE, 0, EXI_SCHEMA_SET_DIN_TYPE);
  }
  #endif /* #if (defined(EXI_ALLOW_SCHEMA_DEVIATION) && (EXI_ALLOW_SCHEMA_DEVIATION == STD_ON)) */
