  Exi_CheckInternalDetErrorReturnVoid((DecWsPtr->OutputData.StorageOffset < DecWsPtr->OutputData.StorageLen), EXI_DECODER_INSTANCE_ID, EXI_API_ID_DECODE_DIN_SERVICE, EXI_E_INV_PARAM);
